  "text" : "土木学会誌、技術的なことは、よくわからないことも多いし、やってる分野にもあんまり興味がないことも多いけど、考え方とか「あぁ、自分はこういうことのために研究してるんだな」とか思うことが多々あるので、ずっと読んでる。",
