  "text" : "そういえば、日本生態系協会からビオトープ管理士試験（とセミナー）の案内が来てた。一応２級計画を持ってるので、あとのものって考えるけど、施工部門はあんまり興味ないし、1級は実務経験いるからなー・・・。",
