  "id_str" : "9371230640",
  "text" : "それと、個人的には、「計算士」って言葉がすごくカッコいいと思う。計算機を使って現実の現象を解明する人たち（計算力学者を含めて）をまとめた総称として「計算士」って使いたいな。",
