  "text" : "そういや、以前どこかで、日本語（原）題と英題の順序が逆になってる理由を見た/聞いた気がするんだけど、なんだったっけ・・・。 QT @kiliya13 「Hard-Boiled Wonderland and the End of the World」読了。勉強も兼ねて読んだつ...",
