  "text" : "3番目のやつは、まぁ特に能力も才能もなくても、大体誰でも書ける。けど、1と2番目は誰にでも作れるわけじゃなくて、1つ目のもので大衆（？）にアピールしつつ、2番目の歌でより深くへ引きずり込むことが出来てる。その2番目がすごい秀逸なのが、マッキーのすごいところ。",
