  "text" : "「多重継承は多くの問題を引き起こすので禁止が妥当であるが、それでも多重継承抜きではうまく扱えない問題が存在する」その通りだと思う。C++→C#ってなって、安全にはなったものの、解決しづらい問題がたくさん出てきたし。 http://bit.ly/biJrgs #extreamcs",
