  "text" : "MPSは（SPHもだけど）、粒子法といっても、粒子はある直径の円/球のような実体のあるものではなくて、MPSの場合は、初期粒子間距離l0があるだけです。まぁ、MPSをガリガリやってる人でも、便宜的にl0を「粒径」とか呼ぶし、結果の描画に直径l0で描いたりするけど。",
